import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import Grid from '@material-ui/core/Grid';
import theme from '../theme';
import { Typography } from '@material-ui/core';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        justifyContent: 'center',
    },
        miniButtons: {
            width: '143px',
            height: '46px',
            marginTop: '25px',
            marginBottom: '25px',
            marginLeft: '25px',
            marginRight: '25px',
            fontSize: '24px',
            borderRadius: '8px',
        },
        text: {
            marginTop: '300px',
            marginBottom: '25px',
            textAlign: 'center',
        },
        input: {
            width: '387px',
            display: 'block',
            marginLeft: 'auto',
            marginRight: 'auto',
            marginTop: '50px',
        }
    }));



function CreateFridge() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container className={classes.root} >
                <Grid item xs={6}>
                    <Grid className={classes.text} item xs={12}>
                        <Typography variant="h1"> What's the name of your community fridge?</Typography>
                    </Grid>
                    <Grid item xs={12}>
                    <TextField className={classes.input} label="Email" variant="outlined" />
                    </Grid>
                    <Grid className={classes.text} item xs={12}>
                        <Button className={classes.miniButtons} variant="contained" color="secondary">Back</Button>
                        <Button className={classes.miniButtons} variant="contained"  color="primary">Next</Button>
                    </Grid>
                </Grid>
            </Grid>
        </ThemeProvider>

    );
}

export default CreateFridge;
